import React, { Component } from 'react';
import Header from '../Header.js';
import ScrollDown from '../Helpers/ScrollDown.js';
import Footer from '../Footer.js';
import MenuGallery from '../MenuGallery.js';
import '../../Assets/Styles/Menu.css';



class Menu extends Component {
  render() {
    return (
      <div className="wrapper">
        <Header headerImage = "menu-header-image" heroTitle = "meny" />

         <div className="container">
          <main>
            <section className="first-section">
              <h2 className="first-section-title">älskade råvaror</h2>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. 
              Consequuntur inventore dolorum nulla, ad vel dolor ex! 
              Assumenda quaerat tenetur delectus, nostrum temporibus! 
              Magnam perferendis tempora vitae, ex ullam optio inventore.</p>
              <ScrollDown />
            </section>
            <MenuGallery />
          </main>
        </div>

          <Footer />
        </div>
    )
  }
}

export default Menu;
